import { Route, Router } from 'react-router-dom';
import './App.css';
import Header from './components/Header.js'
import NotesPage from './page/NotesPage';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Route path="/" exact component={NotesPage} />
      </div>
    </Router>
  );
}

export default App;
